css:
.ink-debugger-container {
  background: #282c34;
  color: #abb2bf;
}
.ink-debugger-container button::before {
  line-height: inherit!important;
}
.ink-debugger-container hr {
  border-top: 1px solid #181a1f;
}
.ink-debugger-container .inner-container {
  overflow-y: auto;
  height: calc(100% - 90px);
}
.ink-debugger-container .code {
  font-family: var(--editor-font-family);
}
.ink-debugger-container .debugger-editor {
  pointer-events: none;
  border-bottom: 1px solid #181a1f;
  padding-bottom: 1em;
}
.ink-debugger-container .item {
  border-bottom: 1px solid #181a1f;
}
.ink-debugger-container .toolbar {
  padding: 0em 1em 0.5em 1em;
  line-height: 2.6em;
}
.ink-debugger-container .toolbar .ink-debug-toolbar {
  width: 100%;
}
.ink-debugger-container .toolbar .ink-debug-toolbar .ink-btn-group-variable-width {
  width: 100%;
  display: flex;
  flex-wrap: wrap;
  flex-direction: row;
}
.ink-debugger-container .toolbar .ink-debug-toolbar .ink-btn-group-variable-width .ink-btn-variable-width {
  flex: 1;
  min-width: 3em;
}
.ink-debugger-container .toolbar .inner-toolbar {
  display: flex;
  flex-direction: row;
  flex-wrap: wrap;
}
.ink-debugger-container .toolbar .inner-toolbar .debugger-runner {
  width: calc(100% + 2em + 10px);
  margin: 0 -1em 0 -1em;
  padding: 0 calc(1em + 5px) 0 calc(1em + 5px);
  background-color: #353b45;
  border-bottom: 1px solid #181a1f;
  display: flex;
}
.ink-debugger-container .toolbar .inner-toolbar .debugger-runner .btn {
  background: #353b45;
  border: none;
  border-radius: 0;
  border-left: 1px solid #181a1f;
}
.ink-debugger-container .toolbar .inner-toolbar .debugger-runner .btn:focus {
  border: none;
  box-shadow: none;
  outline: none;
}
.ink-debugger-container .toolbar .inner-toolbar .debugger-runner select {
  background: #353b45;
  border: none;
  border-left: 1px solid #181a1f;
  padding-left: 1em;
  border-radius: 0;
  width: inherit;
}
.ink-debugger-container .toolbar .inner-toolbar .debugger-runner select:focus {
  border: none;
  box-shadow: none;
  border-left: 1px solid #181a1f;
}
.ink-debugger-container .toolbar .inner-toolbar .flex-table-container {
  right: 10px;
  top: 10px;
}
.ink-debugger-container .toolbar .inner-toolbar .flex-table-container .flex-row {
  padding-left: 0px;
}
.ink-debugger-container .toolbar .next-expression {
  padding-top: 0.4em;
  white-space: nowrap;
  overflow-x: auto;
}
.ink-debugger-container .toolbar .next-expression .code {
  font-family: var(--editor-font-family);
  font-size: var(--editor-font-size);
}
.ink-debugger-container .toolbar .next-expression .tree {
  vertical-align: baseline;
}
.ink-debugger-container .toolbar .next-expression .tree > .header {
  margin: 0;
  padding: 0;
  white-space: pre;
}
.ink-debugger-container .toolbar .next-expression .tree > .header.closed {
  max-height: 1.5em;
  white-space: pre;
}
.ink-debugger-container .toolbar .next-expression .tree > .body {
  max-height: 250px;
}
.ink-debugger-container .toolbar .ink-debug-toolbar {
  position: relative;
  transform: none;
  background-color: inherit;
  position: inherit;
  min-width: inherit;
}
.ink-debugger-container .toolbar .ink-debug-toolbar .code {
  font-family: var(--editor-font-family);
  font-size: var(--editor-font-size);
}
.ink-debugger-container .ink-breakpoint-container .ellipsis-outer {
  max-width: calc(94%);
  direction: rtl;
  position: relative;
  overflow: hidden;
  text-align: left;
}
.ink-debugger-container .ink-breakpoint-container .ellipsis-outer:before,
.ink-debugger-container .ink-breakpoint-container .ellipsis-inner:before {
  position: absolute;
  content: 'â€¦';
  background: #282c34;
  left: -1px;
  z-index: 1;
}
.ink-debugger-container .ink-breakpoint-container .ellipsis-inner {
  display: inline-block;
  white-space: nowrap;
  text-indent: 1em;
  direction: ltr;
  position: relative;
  white-space: pre;
}
.ink-debugger-container .ink-breakpoint-container .ellipsis-inner:before {
  color: #282c34;
  margin-left: -1em;
}
.ink-debugger-container .ink-callstack-container .row.active {
  background-color: #1e4e7b;
}
.ink-debugger-container .flex-table-container {
  padding: 0.5em 1em 1em 1em;
}
.ink-debugger-container .flex-table-container .flex-table {
  display: flex;
}
.ink-debugger-container .flex-table-container .flex-table .flex-row {
  padding: 0 0.5em;
  line-height: 2em;
}
.ink-debugger-container .flex-table-container .flex-table .second {
  flex: 2;
}
.ink-debugger-container .flex-table-container .flex-table .condition {
  flex: 1.5;
}
.ink-debugger-container .flex-table-container .new-bp {
  padding-top: 1em;
  padding-bottom: 2em;
}
.ink-debugger-container .header {
  justify-content: space-between;
  display: flex;
  flex-wrap: wrap;
  flex-direction: row;
  padding: 0.5em 1em 0em 1em;
}
.ink-debugger-container .header h4 {
  line-height: 2em;
  margin: 0;
  font-weight: bold;
}
.ink-debugger-container .ink-table-container .ink-table .table-cell {
  padding: 0.4em 0.5em 0.4em 1em;
  border: none;
}
atom-text-editor.editor .gutter .ink-bp {
  transition: all 0.2s;
}
atom-text-editor.editor .gutter .ink-bp.icon {
  color: #d13b2e;
  position: fixed;
}
atom-text-editor.editor .gutter .ink-bp.icon.inactive {
  color: #7d3431;
}
atom-text-editor.editor .gutter .ink-bp.icon.conditional {
  color: #0f82e6;
}
atom-text-editor.editor .gutter .ink-bp.icon.conditional.inactive {
  color: #1b578d;
}
atom-text-editor.editor .gutter .ink-bp.ink-hide {
  opacity: 0;
  transform: translate(-1em);
}
.ink-toolbar-tooltip {
  margin-top: 0.05em !important;
}
.ink-toolbar-tooltip .tooltip-inner {
  line-height: 0.8 !important;
}
